textOriginal:
Estou cansada de ouvir, ao longo destes 4 anos:
"agora vai ser impichado"; 
"agora vai ter de responder";
"agora vai ter de se explicar";
"agora vai ter de justificar suas mentiras"
"agora sim! vai prá cadeia";
E POR ACASO ALGUÉM QUE TEM ESSE PODER FEZ ALGUMA COISA???
E HOJE, QUEM VAI SER O CARA QUE TERÁ CORAGEM DE ENFRENTAR BOLSONARO, CASSAR A CANDIDATURA E ENFIAR ESSE SER ABJETO NA CADEIA???
